script: |
  super -f text -I q11956.spq | sort > q11956.out

inputs:
  - name: q11956.spq
    data: |
      SELECT - col0 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN ( 40 * col2 + 52 ) AND - ( 39 ) / - 66 - + CAST ( col2 AS REAL ) * ( 46 );
  - name: tab2

outputs:
  - name: q11956.out
    data: |
